import React from "react";
import {getData,codes} from '../data/services';
import { Link } from "react-router-dom";

export const ServicesList=()=>{
  
    return (<div>
     { codes.map((w)=>
     (<div><Link to={`/ServicesList/${w}`}>{getData(w).name}</Link><br/></div>))}
  </div>)
}
